parts:
{
  "name": "UBX-CFG-GNSS",
  "class_id": "0x06",
  "message_id": "0x3E",
  "message_type": "get_set",
  "payload_length": {
    "variable": {
      "base": 4,
      "formula": "4 + numConfigBlocks * 8"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "msgVer",
      "data_type": "U1",
      "fixed_value": 0,
      "description": "Message version (0x00 for this version)"
    },
    {
      "byte_offset": 1,
      "name": "numTrkChHw",
      "data_type": "U1",
      "description": "Number of tracking channels available in hardware (read only)"
    },
    {
      "byte_offset": 2,
      "name": "numTrkChUse",
      "data_type": "U1",
      "description": "(Read only in protocol versions greater than 23) Number of tracking channels to use. Must be > 0, <= numTrkChHw. If OxFF, then number of tracking channels to use will be set to numTrkChHw."
    },
    {
      "byte_offset": 3,
      "name": "numConfigBlocks",
      "data_type": "U1",
      "description": "Number of configuration blocks following"
    }
  ],
  "repeated_block": {
    "num_repeats_field": "numConfigBlocks",
    "fields": [
      {
        "byte_offset": 0,
        "name": "gnssId",
        "data_type": "U1",
        "description": "System identifier (see Satellite Numbering)"
      },
      {
        "byte_offset": 1,
        "name": "resTrkCh",
        "data_type": "U1",
        "description": "(Read only in protocol versions greater than 23) Number of reserved (minimum) tracking channels for this system."
      },
      {
        "byte_offset": 2,
        "name": "maxTrkCh",
        "data_type": "U1",
        "description": "(Read only in protocol versions greater than 23) Maximum number of tracking channels used for this system. Must be > 0, >= resTrkChn, <= numTrkChUse and <= maximum number of tracking channels supported for this system."
      },
      {
        "byte_offset": 3,
        "name": "reserved1",
        "data_type": "U1",
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 4,
        "name": "flags",
        "data_type": "X4",
        "description": "Bitfield of flags. At least one signal must be configured in every enabled system.",
        "bitfields": [
          {
            "name": "enable",
            "bits": 1,
            "bit_offset": 0,
            "description": "Enable this system"
          },
          {
            "name": "reserved1_15",
            "bits": 15,
            "bit_offset": 1,
            "reserved": true
          },
          {
            "name": "sigCfgMask",
            "bits": 8,
            "bit_offset": 16,
            "description": "Signal configuration mask",
            "values": [
              {
                "value": "0x01",
                "description": "GPS L1C/A (when gnssId is 0 (GPS))"
              },
              {
                "value": "0x10",
                "description": "GPS L2C (when gnssId is 0 (GPS))"
              },
              {
                "value": "0x20",
                "description": "GPS L5 (when gnssId is 0 (GPS))"
              },
              {
                "value": "0x01",
                "description": "SBAS L1C/A (when gnssId is 1 (SBAS))"
              },
              {
                "value": "0x01",
                "description": "Galileo E1 (not supported in protocol versions less than 18) (when gnssId is 2 (Galileo))"
              },
              {
                "value": "0x10",
                "description": "Galileo E5a (when gnssId is 2 (Galileo))"
              },
              {
                "value": "0x20",
                "description": "Galileo E5b (when gnssId is 2 (Galileo))"
              },
              {
                "value": "0x01",
                "description": "BeiDou B1I (when gnssId is 3 (BeiDou))"
              },
              {
                "value": "0x10",
                "description": "BeiDou B2I (when gnssId is 3 (BeiDou))"
              },
              {
                "value": "0x80",
                "description": "BeiDou B2A (when gnssId is 3 (BeiDou))"
              },
              {
                "value": "0x01",
                "description": "IMES L1 (when gnssId is 4 (IMES))"
              },
              {
                "value": "0x01",
                "description": "QZSS L1C/A (when gnssId is 5 (QZSS))"
              },
              {
                "value": "0x04",
                "description": "QZSS L1S (when gnssId is 5 (QZSS))"
              },
              {
                "value": "0x10",
                "description": "QZSS L2C (when gnssId is 5 (QZSS))"
              },
              {
                "value": "0x20",
                "description": "QZSS L5 (when gnssId is 5 (QZSS))"
              },
              {
                "value": "0x01",
                "description": "GLONASS L1 (when gnssId is 6 (GLONASS))"
              },
              {
                "value": "0x10",
                "description": "GLONASS L2 (when gnssId is 6 (GLONASS))"
              }
            ]
          },
          {
            "name": "reserved24_31",
            "bits": 8,
            "bit_offset": 24,
            "reserved": true
          }
        ]
      }
    ]
  }
}
